import TopBarNav from '../components/TopBarNavigator'
import Head from 'next/head'

export default class Contact extends React.Component {
    render() {
        return (
            
            <div className='container'>
                
                <TopBarNav currentPage = {4} />
                <div style={{flex: 1, display:'flex', flexDirection: 'row', margin:0, padding: 0, border: 0}}>
                    <div className='galleryContent'>
                        <div style={{maxHeight: '30vh', maxWidth: '100vw', justifyContent: 'center', textAlign:'center', flex:1}}>
                            <p style={{fontFamily: 'Gilroy', fontSize: 30}}>
                                here's how you can contact me.
                            </p>
                        </div>

                    </div>
                </div>
            </div>
        );
    }
}
